-- Table structure for bear_meal
-- ----------------------------
DROP TABLE IF EXISTS `bear_meal`;
CREATE TABLE `bear_meal` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `data` text COMMENT '代理价格j''son数据',
  `price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '会员价格',
  `stock` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存',
  `fen_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '分销方式1，金额；2，百分比',
  `fen_data` text,
  `is_fen` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1,开启；0，关闭',
  `fen_time` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '2,付款后；1，确认收货后',
  `sales` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `express_id` int(11) unsigned NOT NULL,
  `weight` float(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '重量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='套餐表';

-- ----------------------------
-- Records of bear_meal
-- ----------------------------

-- ----------------------------
-- Table structure for bear_menu
-- ----------------------------
DROP TABLE IF EXISTS `bear_menu`;
CREATE TABLE `bear_menu` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
