  `name` char(100) DEFAULT NULL COMMENT '栏目名称',
  `model` char(100) DEFAULT NULL COMMENT '栏目模型',
  `action` char(100) DEFAULT NULL COMMENT '栏目执行方法',
  `extend` text COMMENT '继承上级方法',
  `sort` int(5) DEFAULT NULL COMMENT '排序',
  `icon` char(50) DEFAULT NULL COMMENT '图标',
  `is_show` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COMMENT='管理后台操作栏目';

-- ----------------------------
-- Records of bear_menu
-- ----------------------------

