-- ----------------------------
-- Table structure for bear_order
-- ----------------------------
DROP TABLE IF EXISTS `bear_order`;
CREATE TABLE `bear_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(10) NOT NULL,
  `order_sn` char(100) CHARACTER SET utf8 NOT NULL COMMENT '订单号',
  `money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `coupon_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '优惠金额',
  `coupon_id` int(10) unsigned DEFAULT '0' COMMENT '优惠券id',
  `address_id` int(10) unsigned DEFAULT '0' COMMENT '收货地址id',
  `prepay_id` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '支付返回ID',
  `timestamp` datetime DEFAULT NULL,
  `is_show` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '是否显示，1显示',
  `express` char(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '快递单',
  `pay_money` decimal(10,2) unsigned DEFAULT NULL COMMENT '付款金额',
  `pay_status` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '支付状态，1，未支付；2，已支付；3，已经退款',
  `express_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '快递id',
  `express_name` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT '0' COMMENT '快递名称',
  `delete_time` varchar(10) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `type` enum('0','1','3','2') CHARACTER SET utf8 NOT NULL DEFAULT '0' COMMENT '订单类型，0，普通订单；1，秒杀订单；2，拼单订单；3,预售商品',
  `status` enum('3','2','0','1','4','5','6') CHARACTER SET utf8 NOT NULL DEFAULT '0' COMMENT '3，待收货；2，已收货；1，已取消;0,未付款；4，待发货；5,待付尾款;6,已退款',
  `refund` enum('3','2','4','1') CHARACTER SET utf8 DEFAULT '1' COMMENT '1，正常；2，申请退款待处理；3，退款申请拒绝；4，退款成功',
  `is_delete` enum('1','0') CHARACTER SET utf8 DEFAULT '0' COMMENT '0,正常；1，删除',
  `balance_money` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '预售订单剩余需要支付的金额',
  `address` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '收货地址详细地址',
  `phone` varchar(30) CHARACTER SET utf8 DEFAULT NULL COMMENT '收货人手机',
  `city` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '城市',
  `province` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '省份',
  `area` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '县区',
  `num` int(10) unsigned DEFAULT '0' COMMENT '商品总数量',
  `created_at` datetime DEFAULT NULL COMMENT '创建时间',
  `name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '收货人姓名',
  `confirmd_at` datetime DEFAULT NULL COMMENT '确认收货时间',
  `advance_tail_money` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '预售商品尾款',
  `one_money` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '一级分销佣金',
  `two_money` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '二级分销佣金',
  `freight_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `pay_type` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '付款类型，1，微信；0，余额',
  `activity_id` int(11) NOT NULL DEFAULT '0' COMMENT '活动id',
  `agent_id` int(11) DEFAULT '0' COMMENT '代理id',
  `is_distribution` tinyint(1) DEFAULT '1' COMMENT '1,未分销；2，已分销',
  `order_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1,普通商品；2，套餐；',
  `t_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '套餐id',
  `express_time` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1419 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of bear_order
